import React, { Component } from 'react';
import { withStyles } from '@material-ui/core/styles';
import styles from './create-ftr.style';
import Button from '@material-ui/core/Button';
import { raiseFTRRequest } from '../../../../actions/scenario.action';
import { connect } from 'react-redux';

class CreateFTR extends Component {

    constructor() {
        super();
        this.onSubmit = this.onSubmit.bind(this);
    }

    onSubmit() {
        this.props.raiseFTRRequest();
    }

    render() {
        const { classes } = this.props;

        return (
            <React.Fragment>
                <div className={classes.btnContainer}>
                    <Button className="btn-primary" onClick={this.onSubmit} variant="contained" size="medium" color="primary">
                        Submit
                    </Button>
                </div>
            </React.Fragment>
        )
    }
}

const mapStateToProps = state => {
    return {
        customerInfo: state.customerInfo.customerInfo,
        prospectCircle: state.customerInfo.prospectCircle
    };
};

const mapDispatchToProps = dispatch => ({
    raiseFTRRequest: () => dispatch(raiseFTRRequest())
});

export default connect(mapStateToProps, mapDispatchToProps)(withStyles(styles, { withTheme: true })(CreateFTR));
